import { StatusBar } from 'expo-status-bar';
import React, { useState } from 'react';
import { StyleSheet, Text, View, Pressable, Image, Button, TextInput } from 'react-native';
import ProfileList from './profileList';


export default function changePassword({navigation}) {
  const [password, setPassword] = useState();

  return (
    <View style={styles.container}>
      <Text style={{ left: "5%", fontSize: 30, marginBottom:50}}> Change Password</Text>
      <TextInput style={{color:"white", alignSelf:"center", fontWeight:"500", fontSize:15}}
        onChangeText={setPassword} value={password} placeholderTextColor="grey" placeholder="Enter new password" style={styles.textInput} />
      <Pressable style={{backgroundColor:"#004275", justifyContent:"center", height:50, margin:5, marginTop: 25, borderRadius:10}}
      onPress={()=>navigation.navigate("MainProfile")}>
        <Text style={{color:"white", alignSelf:"center", fontWeight:"500", fontSize:15}}>
          Submit
        </Text>
        </Pressable> 
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    paddingTop:50,
    flex: 1,
    backgroundColor: '#fff',
  },
  title: {
    fontSize: 20,
    fontWeight: "500",
  },
  listContainer: {
    padding: 20,
  }
});
